import React from 'react';


class Destiny extends React.Component {
  render() {

    return (
      <select name="select"onChange>
        <option>Buenos Aires</option>
        <option>Sydney</option>
        <option>Praga</option>
        <option>Boston</option>
        <option>Tokio</option>
      </select>
    )
  }
}

export default Destiny;
